import React from "react";
import Home from "./Components/Home";
import { Routes, Route } from "react-router-dom";

const App = () => {
  return (
    <div>
      <Home />
      <Routes>
        <Route path="/" element={<Home />}></Route>
      </Routes>
    </div>
  );
};

export default App;
